import React from 'react';



const iss = []
fetch('http://api.open-notify.org/iss-now.json')
.then (Response => {return Response.json()})
.then (data => iss.push(data))

const App = () => {
    return (
        <div>
            <div>
                <p>`The current location of the ISS is longitude: ${iss[0].iss_position.longitude}, latitude ${iss[0].iss_position.latitude}`</p>     
            </div>
            <button>Click here to know!</button>
        </div>
    )
}

export default App;
